import React, { useContext } from "react";
import AuthContext from "../context/AuthContext";

import { useState, useEffect } from "react";
import axios from "axios";
import Header from "../components/Header";

const DashboardPage = () => {
  let { user, authTokens } = useContext(AuthContext);
  let [stocks, setStocks] = useState([]);
  let [stockInfo, setStockInfo] = useState([]);

  const getWatchlist = async () => {
    try {
      const response = await axios.get('http://localhost:8000/api/watchlist-retrieve/', {
        headers : {
            Authorization: `Bearer ${authTokens.access}`
        }
      })
      console.log("watchlist retrieved: ", response.data)
      setStocks(response.data.map(stock => stock['ticker']))
    } catch (error) {
      console.error("error fetching data");
    }
  }

  const handleDelete = async (ticker) => {
    try {
      const response = await axios.post('http://localhost:8000/api/watchlist-remove/', {ticker}, {
        headers : {
          Authorization: `Bearer ${authTokens.access}`
        } 
      })
      setStocks(oldStocks => oldStocks.filter(tick => tick !== ticker))
    } catch (error) {
      console.error("failed to delete stock")
    }
  }

  useEffect(() => {
     //when stocks is populated, need to retrieve info for each stock
     const fetchInfo = async() => {
      try {
        const reqs = stocks.map(stock => 
        axios.get('http://localhost:8000/api/stock-info/', {
          params: { input: stock }
        })) 
        const responses = await Promise.all(reqs)
        setStockInfo(responses.map(res => res.data.info))
        console.log("stock info retrieved")
       } catch (error) {
        console.error("failed to fetch stock info ")
       }
     }

     fetchInfo()
    
  }, [stocks])

  useEffect(() => {
    getWatchlist()
  }, [authTokens])

  return (
    <div
      className="min-h-screen bg-cover bg-center flex items-start justify-center"
      style={{
        backgroundImage:
          "url('https://images.unsplash.com/photo-1451187580459-43490279c0fa?q=80&w=3872&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D')",
      }}
    >
      <Header />

      
      <div className="w-2/3 mt-48">
        <h1 className="text-5xl font-bold text-white mb-8">{user.username.charAt(0).toUpperCase() + user.username.slice(1) }'s Assets</h1>

        
        {/* change to generate one for each resulting stock from api call, now just temp values */}

        <div className="flex flex-col space-y-6">
  {stockInfo.map((stock, index) => {
    // Determine text color based on price change
    let priceChangeColor = "text-black"; // Default to black
    const priceChange = stock['current-price'] - stock['open-price'];
    if (priceChange > 0) {
      priceChangeColor = "text-green-500"; // Green for positive change
    } else if (priceChange < 0) {
      priceChangeColor = "text-red-500"; // Red for negative change
    }

    return (
      <div
        key={index}
        className="bg-white p-4 rounded-lg shadow-md mx-auto flex items-center justify-between space-x-4"
      >
        <div className="flex-1">
          <span
            className={`font-bold text-xl ${priceChangeColor}`}
          >
            {stock['ticker']}
          </span>
          <div className="flex items-center space-x-4 mt-2">
            <span className="font-bold">Current: ${stock['current-price'].toFixed(2)}</span>
            <span className="font-bold">Open: ${stock['open-price'].toFixed(2)}</span>
            <span className="font-bold">Close: ${stock['close-price'].toFixed(2)}</span>
            <span className={`font-bold ${priceChangeColor}`}>
              Change: ${priceChange.toFixed(2)}
            </span>
          </div>
        </div>
        <button
          onClick={() => handleDelete(stock['ticker'])}
          className="bg-red-500 text-white p-2 rounded-full hover:bg-red-600 transition-colors duration-300"
        >
          <svg
            xmlns="http://www.w3.org/2000/svg"
            className="h-6 w-6"
            fill="none"
            viewBox="0 0 24 24"
            stroke="currentColor"
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth="2"
              d="M6 18L18 6M6 6l12 12"
            />
          </svg>
        </button>
      </div>
    );
  })}
</div>


       

      </div>

    </div>
  );
};

export default DashboardPage;
